import React, { Component } from "react";
import "../App.css";
export default class Footer extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const { companyName, copyRight } = this.props;
    return (
      <div>
        <p className="text-head">
          Powered By {companyName} | Contact me : {copyRight}
        </p>
      </div>
    );
  }
}
